import "./Layout.scss"

function Layout() {
    return (
        <main className="login-page">
            <Routes>
                <Route path="/">
                    <Route path="" element={<Navigate to="/dashboard" replace={true} />} />
                    <Route path="dashboard" element={<LoginPage />} />
                    <Route path="login" element={<LoginPage />} />
                </Route>
            </Routes>
        </main>
    );
}

export default Layout
